function getSignature(uniqueKey,name,email,contact){

    var storageRef = firebase.storage().ref();
    storageRef.child('signatures/'+uniqueKey).getDownloadURL().then(function (url) {

        var xhr = new XMLHttpRequest();
        xhr.responseType = 'blob';
        xhr.onload = function (event) {
            var blob = xhr.response;
            console.log(blob);

            var reader = new FileReader();
            reader.readAsDataURL(blob);
            reader.onloadend = function () {
                base64data = reader.result;
                console.log(base64data);
                resImg = base64data;
                generatePDF(name,email,contact);
            }
            //pdfMake.createPdf(docDefinition).download('optionalName.pdf');
        };
        xhr.open('GET', url);
        xhr.send();

        console.log(url);
    }).catch(function (error) {
        // Handle any errors
    });
}

function submitData() {

    var name = $('#name').val();
    var email = $('#email').val();
    var parentGuardianName = $('#parentGuardianName').val();
    var contactNo = $('#contactNo').val();

    var consent1 = false;
    var consent2 = false;
    var consent3 = false;

    var parentGuardianSignature = "";
    var signature = "";

    if ($('#consent1').prop('checked')) {
        consent1 = true;
    }

    if ($('#consent2').prop('checked')) {
        consent2 = true;
    }

    if ($('#consent3').prop('checked')) {
        consent3 = true;
    }

    

    var uniqueKey = firebase.database().ref().child('consentFormData').push().key;

    if(parentGuardianName!=""){
        parentGuardianSignature = "signatures/"+uniqueKey;
    }else{
        signature="signatures/"+uniqueKey;
    }

    if(name!="" && email!="" && contactNo!="" && consent1==true && consent2==true && consent3==true && (parentGuardianSignature!=""||signature!="")){
        consentDataRef.child(uniqueKey).set({

            "email": email,
            "contactNo": contactNo,
            "name": name,
            "parentGuardianName": parentGuardianName,
    
            "consent1": consent1,
            "consent2": consent2,
            "consent3": consent3,
    
            "date": getCurrentDate(),
    
            "signature": signature,
            "parentGuardianSignature": parentGuardianSignature,
            "uniqueKey":uniqueKey
        });

        var signaturePad = getSignaturePad();
        var dataURL = signaturePad.toDataURL();


        var storageRef = firebase.storage().ref();
        var signatureRef = storageRef.child('signatures/'+uniqueKey);
        var dataURL1 = (dataURL.split(',')[1]);

        signatureRef.putString(dataURL1, 'base64', { contentType: 'image/png;base64' }).then(function (snapshot) {
            console.log('Uploaded a base64 string!');
        });

    }
    
}
